import React, { useState } from 'react';
import { Link, useLocation, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import { 
  FaUtensils, 
  FaShoppingCart, 
  FaHistory, 
  FaCog, 
  FaSignOutAlt, 
  FaUser,
  FaBars,
  FaTimes
} from 'react-icons/fa';
import './Header.css';

const Header = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isUserMenuOpen, setIsUserMenuOpen] = useState(false);
  const location = useLocation();
  const navigate = useNavigate();
  const { user, isAuthenticated, isAdmin, logout } = useAuth();

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const toggleUserMenu = () => {
    setIsUserMenuOpen(!isUserMenuOpen);
  };

  const handleLogout = () => {
    logout();
    setIsUserMenuOpen(false);
    navigate('/');
  };

  const isActive = (path) => {
    return location.pathname === path;
  };

  return (
    <header className="header">
      <div className="header-container">
        <div className="header-left">
          <Link to="/" className="logo">
            <FaUtensils />
            <span>Canteen</span>
          </Link>
          
          <button className="mobile-menu-toggle" onClick={toggleMenu}>
            {isMenuOpen ? <FaTimes /> : <FaBars />}
          </button>
        </div>

        <nav className={`nav-menu ${isMenuOpen ? 'active' : ''}`}>
          <Link 
            to="/" 
            className={`nav-link ${isActive('/') ? 'active' : ''}`}
            onClick={() => setIsMenuOpen(false)}
          >
            Menu
          </Link>
          
          {isAuthenticated && (
            <>
              <Link 
                to="/order-history" 
                className={`nav-link ${isActive('/order-history') ? 'active' : ''}`}
                onClick={() => setIsMenuOpen(false)}
              >
                <FaHistory />
                <span>Order History</span>
              </Link>
            </>
          )}

          {isAdmin && (
            <div className="admin-dropdown">
              <button className="admin-toggle">
                Admin
                <span className="dropdown-arrow">▼</span>
              </button>
              <div className="admin-menu">
                <Link 
                  to="/admin/menu" 
                  className="admin-link"
                  onClick={() => setIsMenuOpen(false)}
                >
                  Manage Menu
                </Link>
                <Link 
                  to="/admin/orders" 
                  className="admin-link"
                  onClick={() => setIsMenuOpen(false)}
                >
                  Manage Orders
                </Link>
              </div>
            </div>
          )}
        </nav>

        <div className="header-right">
          {isAuthenticated ? (
            <div className="user-menu">
              <button className="user-toggle" onClick={toggleUserMenu}>
                <FaUser />
                <span className="user-name">{user?.name}</span>
                <span className="dropdown-arrow">▼</span>
              </button>
              <div className={`user-dropdown ${isUserMenuOpen ? 'active' : ''}`}>
                <Link 
                  to="/profile" 
                  className="user-link"
                  onClick={() => setIsUserMenuOpen(false)}
                >
                  <FaUser />
                  Profile
                </Link>
                <button className="user-link logout-btn" onClick={handleLogout}>
                  <FaSignOutAlt />
                  Logout
                </button>
              </div>
            </div>
          ) : (
            <div className="auth-buttons">
              <Link to="/login" className="auth-btn login-btn">
                Login
              </Link>
              <Link to="/register" className="auth-btn register-btn">
                Register
              </Link>
            </div>
          )}
        </div>
      </div>
    </header>
  );
};

export default Header;
